import React from "react";
import Header from "../../Components/Header";
import HowTo from "../../Components/HowTo";
import Partner from "../../Components/Partner";
import ProductsHome from "../../Components/ProductsHome";

const Main = props => {
    return (
        <div>
            <Header />
            <HowTo />
            <Partner />
            <ProductsHome />
        </div>
    );
};

export default Main;
